import React, {Component} from 'react';
import Header from './Header.js';
import About from './About.js';

class Main extends Component {
  render() {
    return (
      <main id="main">
        <div className="site-section site-portfolio">
          <div className="container">
            <Header />

          </div>
        </div>

        <About />  
      </main>
    );
  }

}

export default Main;
